export const DAYS = ["Mon", "Tue", "Wed", "Thur", "Fri", "Sat", "Sun"];

export const MOCKAPPS = [
  { date: new Date(2024, 1, 3), title: "appoint", color: "#238783" },
  { date: new Date(2024, 1, 6), title: "doctos", color: "#708898" },
  { date: new Date(2024, 1, 25), title: "bd", color: "#047106" },
  { date: new Date(2024, 1, 3), title: "second", color: "#371395" }
];
